{
  "title": "failed authentications",
  "type": "histogram",
  "params": {
    "shareYAxis": true,
    "addTooltip": true,
    "addLegend": true,
    "legendPosition": "bottom",
    "scale": "linear",
    "mode": "stacked",
    "times": [],
    "addTimeMarker": false,
    "defaultYExtents": false,
    "setYExtents": false,
    "yAxis": {}
  },
  "aggs": [
    {
      "id": "1",
      "enabled": true,
      "type": "count",
      "schema": "metric",
      "params": {}
    },
    {
      "id": "2",
      "enabled": true,
      "type": "date_histogram",
      "schema": "segment",
      "params": {
        "field": "@timestamp",
        "interval": "auto",
        "customInterval": "2h",
        "min_doc_count": 1,
        "extended_bounds": {}
      }
    },
    {
      "id": "3",
      "enabled": true,
      "type": "filters",
      "schema": "group",
      "params": {
        "filters": [
          {
            "input": {
              "query": {
                "query_string": {
                  "query": "programname: sshd AND facility: authpriv AND \"authentication failure\"",
                  "analyze_wildcard": true
                }
              }
            },
            "label": "ssh auth failure"
          },
          {
            "input": {
              "query": {
                "query_string": {
                  "query": "programname: sshd AND facility: authpriv AND \"session opened for user\"",
                  "analyze_wildcard": true
                }
              }
            },
            "label": "ssh login"
          },
          {
            "input": {
              "query": {
                "query_string": {
                  "query": "programname: sshd AND facility: authpriv AND \"session closed for user\"",
                  "analyze_wildcard": true
                }
              }
            },
            "label": "ssh logout"
          }
        ]
      }
    }
  ],
  "listeners": {}
}
